import {
    createAction 
}
from "./createAction";

const onUppdate = createAction({
    name: "ON_UPPDATE",
    payload: [
        "seconds"
    ]
});

const onSetIndicator = createAction({
    name: "ON_SET_INDICATOR",
    payload: [
        "indicator"
    ]
});

export {
    onUppdate,
    onSetIndicator
}
